import { useEffect } from "react";
import { connect } from "react-redux";
import { fetchBookmarks } from "../../store/actions/index";
const Bookmarks = () => {
  return <div>book</div>;
};

const mapStateToProps = (state) => {
  return {
    search: state.search,
  };
};

export default connect(mapStateToProps, { fetchBookmarks })(Bookmarks);
